import { Tabs, Layout, Table, Tag, Space } from "antd";

import { Typography } from 'antd';
const {  Content } = Layout;

const { Title } = Typography;

const columns = [
  {
    title: 'Mã Sản Phẩm',
    dataIndex: 'MaSP',
    key: 'MaSP',
    render: text => <a>{text}</a>,
  },
  {
    title: 'Tên Sản Phẩm',
    dataIndex: 'TenSP',
    key: 'TenSP',
  },
  {
    title: 'Số lượng',
    dataIndex: 'SoLug',
    key: 'SoLug',
  },
  {
    title: 'Tổng tiền',
    key: 'TongTien',
    dataIndex: 'TongTien',
  },
  {
    title: 'Action',
    key: 'action',
    render: (text, record) => (
      <Space size="middle">
        <a>Invite {record.name}</a>
        <a>Delete</a>
      </Space>
    ),
  },
];

const data = [
  {
    MaSP: '1',
    TenSP: 'John Brown',
    SoLug: 32,
    TongTien: '1000000',
  },
  {
    MaSP: '2',
    name: 'Jim Green',
    TenSP: 42,
    TongTien: '1000000',
  },
  {
    MaSP: '3',
    TenSP: 'Joe Black',
    SoLug: 32,
    TongTien: '1000000',
  },
];
function DoanhThu() {
    return (
        <Layout>
            <Content>
                <Table columns={columns} dataSource={data} />
            </Content>
        </Layout>
    );
}
export default DoanhThu;
